            array("salespoint"=>"HO TANGERANG","form_type"=>11,"urutan_nik"=>" 22000098, 18000353","urutan_employee_position"=>"Industrial Relation Manager, Compensation & Benefit Manager","urutan_sign_as"=>"Dibuat Oleh, Disetujui Oleh","notes"=>"Industrial Relationship"),
            array("salespoint"=>"HO TANGERANG","form_type"=>10,"urutan_nik"=>" 22000098, 18000353","urutan_employee_position"=>"Industrial Relation Manager, Compensation & Benefit Manager","urutan_sign_as"=>"Dibuat Oleh, Disetujui Oleh","notes"=>"Legal and Compliance"),
            array("salespoint"=>"HO TANGERANG","form_type"=>11,"urutan_nik"=>" 22000098, 18000353","urutan_employee_position"=>"Industrial Relation Manager, Compensation & Benefit Manager","urutan_sign_as"=>"Dibuat Oleh, Disetujui Oleh","notes"=>"Legal and Compliance"),
            array("salespoint"=>"HO TANGERANG","form_type"=>10,"urutan_nik"=>"08130327, 18000353","urutan_employee_position"=>"Talent Acquisition Manager, Compensation & Benefit Manager","urutan_sign_as"=>"Dibuat Oleh, Disetujui Oleh","notes"=>"Recruitment"),
            array("salespoint"=>"HO TANGERANG","form_type"=>11,"urutan_nik"=>"08130327, 18000353","urutan_employee_position"=>"Talent Acquisition Manager, Compensation & Benefit Manager","urutan_sign_as"=>"Dibuat Oleh, Disetujui Oleh","notes"=>"Recruitment"),
